import React from "react";
import './signup.css';
const Signup = () => {
  return (
    <div>
    
      <form className="signup_form">
      <h1>Signup</h1>
        <input className="signup_options" placeholder="name"></input>

        <input  className="signup_options" placeholder="email"></input>

        <input  className="signup_options" placeholder="phone"></input>

        <input  className="signup_options" placeholder="work"></input>

        <input className="signup_options" placeholder="password"></input>

        <input  className="signup_options" placeholder="cpassword"></input>

        <button className="signup_options" type="submit">submit</button>

      </form>
    </div>
  );
};

export default Signup;
